     QScriptValue REcmaAttributeEntity::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RAttributeEntity* self = getSelf("RAttributeEntity", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RAttributeEntity* REcmaAttributeEntity::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RAttributeEntity* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RAttributeEntity >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RAttributeEntity.%1(): "
                        "This object is not a RAttributeEntity").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RAttributeEntity* REcmaAttributeEntity::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RAttributeEntity* selfBase = getSelf(fName, context);
                RAttributeEntity* self = dynamic_cast<RAttributeEntity*>(selfBase);
                //return REcmaHelper::scriptValueTo<RAttributeEntity >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RAttributeEntity.%1(): "
                    "This object is not a RAttributeEntity").arg(fName),
                    context);
            }

            return self;
            


        }
        